import React, { Component } from 'react';

class Contents extends Component {
    render() {
        const movie_list = [];
        const movies = this.props.data;
        console.log('Contents.js' + this.props.selected_year);
        let i = 0;
        while (i < movies.length) {
            movie_list.push(
                <li key={movies[i].id}>
                    <a
                        href=""
                        onClick = {(e) => {
                            e.preventDefault();
                        }}
                    >
                        <img src={movies[i].photo} alt=""/>
                        <p>{movies[i].title}</p>
                    </a>
                </li>);
            i++;
        }

        return (
            <ul className="movie_list">
                { movie_list }
            </ul>
        );
    }
}

export default Contents;
